  \"2016-11-25T21:06:32.118992\",\n\t\"name\": \"pre-elementary-education-longitudinal-study\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"PEELS is a study that is part of the Pre-Elementary
  Education Longitudinal Study. PEELS (http://ies.ed.gov/ncser/projects/peels/) is
  a longitudinal survey that is designed to describe the characteristics of children
  receiving preschool special education, their educational programs and services,
  and their transitions from preschool programs to elementary schools. The study was
  conducted using CATI, paper questionnaires, and child assessments. The study followed
  a nationally representative sample of children with disabilities who were 3 to 5
  years old at the start of the study in 2003 through 2009, examining the achievement
  of students with disabilities in preschool, kindergarten, and elementary school
  and determining the factors associated with this achievement. Key statistics produced
  from PEELS are characteristics of children and their families; characteristics of
  educational services and providers; transitions from early intervention to preschool,
  and preschool to elementary school; and school-related readiness and behavior.\",\n\t\"license_title\":
